import axios from 'axios';

const API_URL = "https://api.themoviedb.org/3/"
const displayPopular = async () => {
    const data = await axios.get(`${API_URL}/movie/popular`, {
        params: {
            api_key: 'ea3be2f95f0304ae77a5f0d9781cb892'
        }
    })
    console.log(data);
}

export { displayPopular };
